import React from 'react'
import { Box, Typography, List, Divider, } from "@mui/material"
import { MealPlan } from "./";
import AddIcon from '@mui/icons-material/Add';
import DeleteIcon from '@mui/icons-material/Delete';

const CustomList = ({ itemList }) => {
    return (

        <Box id="Upcoming Plans" sx={{ bgcolor: 'background.paper', width: '100%', display: 'flex', flexDirection: 'column', color: 'text.primary', margin: '2rem', borderRadius: '10px' }}>
            <Typography varient="h2" component="h2" align="center" sx={{ color: 'white', fontWeight: 'bold', fontSize: '2rem' }} color="primary.light" >Upcoming Plans</Typography>
            <List >
                {itemList.map((item, idx) => <MealPlan key={idx} item={item} icon={<DeleteIcon fontSize='medium' sx={{ color: 'black' }} />} />)}
                <Divider key="divider" sx={{ bgcolor: 'primary.main', height: '3px' }} />
                <MealPlan key="add" item={[["Add upcoming plan"]]} icon={<AddIcon fontSize='medium' sx={{ color: 'black', stroke: "#000000", strokeWidth: '1' }} />} />
            </List>

        </Box>
    )
}

export default CustomList
